import React, { useRef, useState, useEffect, useCallback } from "react";
import { Paper, Grid, Box } from "@material-ui/core";
import RemoveRedEyeIcon from "@mui/icons-material/RemoveRedEye";
import MoreHorizIcon from "@material-ui/icons/MoreHoriz";
import { useSpring, animated, useTransition } from "react-spring";
import Crop54Icon from "@mui/icons-material/Crop54";
import CropPortraitIcon from "@mui/icons-material/CropPortrait";
import ViewArrayIcon from "@mui/icons-material/ViewArray";
import CropIcon from "@mui/icons-material/Crop";
import ViewColumnIcon from "@mui/icons-material/ViewColumn";
import AspectRatioTwoToneIcon from "@mui/icons-material/AspectRatioTwoTone";
import StarIcon from "@mui/icons-material/Star";
import Brightness2Icon from "@mui/icons-material/Brightness2";
import AlbumIcon from "@mui/icons-material/Album";
import BentoIcon from "@mui/icons-material/Bento";
import MoreVertIcon from "@mui/icons-material/MoreVert";
import CommentIcon from "@mui/icons-material/Comment";
import SentimentVerySatisfiedIcon from "@material-ui/icons/SentimentVerySatisfied";
import CircleIcon from "@mui/icons-material/Circle";
import { RootStateOrAny, useSelector, useDispatch } from "react-redux";
import { matchMobile, matchPc, matchTablet } from "./DetectDevice";
import { UpdateTutorials } from "./GlobalActions";


import AddIcon from "@mui/icons-material/Add";
import {
  UpdateReactType,
  Updatepagenum,
} from "./GlobalActions";

import { useInView } from "react-intersection-observer";

function Tutorialx({ type, index }: any) {





  const {
    REACT_APP_SUPERSTARZ_URL,
    REACT_APP_CLOUNDFRONT,
    REACT_APP_APPX_STATE,
  } = process.env;



  const dispatch = useDispatch();











  ///
  ///
  ///
  /// GET LOGGED USER DATA FROM REDUX STORE
  interface RootStateReducerImage {
    UserdataReducer: {
      image: string;
      reg: number;
      id: number;
    };
  }
  const { image, id, reg } = useSelector((state: RootStateReducerImage) => ({
    ...state.UserdataReducer,
  }));
  const imageReducer = image;
  const idReducer = id;
  const regReducer = reg;





  ///
  ///
  ///
  /// GET LOGGED USER DATA FROM REDUX STORE
  interface RootStateReducerImage {
    GlobalReducerLoader: {
      loader: boolean;
      clickPostHint: string;
      clickPostHintState: boolean;
      connectHint: string;
      connectHintState: boolean;
      minimiseHint: string;
      minimiseHintState: boolean;
      interactHint: string;
      interactHintState: boolean;
      EditHint: string;
      EditHintState: boolean;
      interactionstartHint: string;
      interactionstartHintState: boolean;
      adjustinteractionHint: string;
      adjustinteractionHintState: boolean;
    };
  }
  const { clickPostHint, clickPostHintState, connectHint, connectHintState, minimiseHint, minimiseHintState, interactHint, interactHintState,
    EditHint, EditHintState, interactionstartHint, interactionstartHintState } = useSelector((state: RootStateReducerImage) => ({
      ...state.GlobalReducerLoader,
    }));





  return <>


    {type === 1 && index === 0 && clickPostHintState && regReducer === 1 ?

      <Grid container

        style={{
          height: "0px",
          width: '100%',
          position: 'fixed',
          top: matchMobile ? '26vh' : '60vh',
          left: '20vw',
          zIndex: 50000,
          color: 'whitesmoke',
          fontFamily: 'sans-serif'
        }}>
        <Grid
          xs={12}
          item

        >

          <span
            onClick={() => {
              dispatch(UpdateTutorials(type, false));
            }}
            style={{
              backgroundColor: 'black',
              padding: '2vh',
              position: 'absolute',
              top: '-70vh',
              cursor: 'pointer'
            }}>Click On Image For Interactions</span>

        </Grid>

      </Grid> : null

    }

    {type === 2 && index === 1 && minimiseHintState && regReducer === 1 ?

      <Grid container

        style={{
          height: "0px",
          width: '100%',
          position: 'fixed',

          top: matchMobile ? '20vh' : '53vh',
          left: matchMobile ? '9vw' : '6vw',
          zIndex: 50000,
          color: 'whitesmoke',
          fontFamily: 'sans-serif'
        }}>
        <Grid
          xs={12}
          item

        >

          <span

            onClick={() => {
              dispatch(UpdateTutorials(type, false));
            }}
            style={{
              backgroundColor: 'black',
              padding: '3vh',
              cursor: 'pointer'
            }}>Click circle To Minimise</span>

        </Grid>

      </Grid> : null

    }



    {type === 3 && index === 2 && connectHintState && regReducer === 1 ?

      <Grid container

        style={{
          height: "0px",
          width: '100%',
          position: 'fixed',
          top: matchMobile ? '30vh' : '73vh',
          left: '1vw',
          zIndex: 50000,
          color: 'whitesmoke',
          fontFamily: 'sans-serif'
        }}>
        <Grid
          xs={12}
          item

        >

          <span

            onClick={() => {
              dispatch(UpdateTutorials(type, false));
            }}

            style={{
              backgroundColor: 'black',
              padding: '3vh',
              cursor: 'pointer'
            }}>Double Click Profile Pic To Add Favorites</span>

        </Grid>

      </Grid> : null

    }



    {type === 4 && index === 3 && interactHintState && regReducer === 1 ?

      <Grid container

        style={{
          height: "0px",
          width: '100%',
          position: 'fixed',
          top: matchMobile ? '20vh' : '43vh',
          left: matchMobile ? '5vw' : '20vw',
          zIndex: 50000,
          color: 'whitesmoke',
          fontFamily: 'sans-serif'
        }}>
        <Grid
          xs={12}
          item

        >

          <span

            onClick={() => {
              dispatch(UpdateTutorials(type, false));
            }}

            style={{
              backgroundColor: 'black',
              padding: '3vh',
              cursor: 'pointer'
            }}>Interactions vibrate then become clickable</span>

        </Grid>

      </Grid> : null

    }



    {type === 5 && EditHintState && regReducer === 1 ?

      <Grid container

        style={{
          height: "0px",
          width: '100%',
          position: 'fixed',
          top: '43vh',
          left: '42vw',
          zIndex: 50000,
          color: 'whitesmoke',
          fontFamily: 'sans-serif'
        }}>
        <Grid
          xs={12}
          item

        >

          <span

            onClick={() => {
              dispatch(UpdateTutorials(type, false));
            }}

            style={{
              backgroundColor: 'black',
              padding: '3vh',
              cursor: 'pointer'
            }}>Double This Image Click To Add Media</span>

        </Grid>

      </Grid> : null

    }


    {type === 6 && interactionstartHintState && regReducer === 1 ?

      <Grid container

        style={{
          height: "0px",
          width: '100%',
          position: 'fixed',
          top: '43vh',
          left: '12vw',
          zIndex: 50000,
          color: 'whitesmoke',
          fontFamily: 'sans-serif'
        }}>
        <Grid
          xs={12}
          item

        >

          <span
            onClick={() => {
              dispatch(UpdateTutorials(type, false));
            }}

            style={{
              backgroundColor: 'black',
              padding: '3vh',
              cursor: 'pointer'
            }}> Click On This Image To Add Interaction</span>

        </Grid>

      </Grid> : null

    }



  </>;
}





export const Tutorial = React.memo(Tutorialx);
